import React from "react";

const ArticlePage = ({ match }) => {
  const name = match.params.name;
  return (
    <React.Fragment>
      <h1>Article</h1>
      <p>This is the {name} article!</p>
      <p>Second paragraph</p>
      <p>leThird paragraph</p>
    </React.Fragment>
  );
};

export default ArticlePage;
